import React from "react";
import eth from "../assets/token/eth.logo";
import bnb from "../assets/token/bnb.logo";
import btc from "../assets/token/btc.logo";
import usd from "../assets/token/usd.logo";
import ada from "../assets/token/ada.logo";
import sol from "../assets/token/sol.logo";

export default function ModalToken(token) {
  return (
    <div>
      <img className="img" src={eth} alt="" />
      <span className="name">ETH</span>
    </div>
  );
}
